Burn Notice Season 1

DvDRip

The series revolves around secret agent Michael Weston who gets the titular burn notice, which is how a spy gets fired and taken out of the game. Unfortunately, Weston has no idea why he&amp;#039;s suddenly an untouchable, and trying to get to the bottom of the mystery is rather difficult and dangerous without being able to use his previous resources and contacts.

Completely written and created by Matt Nix, this new USA series combines various action and thriller elements with a fresh sense of humour played out by a new breed of spy.



